import React from 'react';
import { Link } from "react-router-dom";

import "./squareLink.css";

const SquareLink = ({to = "/", color, text = "", children}) => {
    
    return (
        <Link to={to} className="square-link" >
            <div>
                <div>{children}</div>
                <div>{text}</div>
            </div>
        </Link>
    )
}

export default SquareLink;
